import React, { Component } from 'react';
// import { HashLink as Link } from 'react-router-hash-link';
// import Lottie from 'react-lottie';
// import Footer from './components/Footer';
import { Route } from 'react-router-dom';

// import Navbar from 'pages/PageLanding/components/Navbar';

import PageMain from 'pages/PageLanding/routes/PageMain';
import PageSupport from 'pages/PageLanding/routes/PageSupport';
import PageAbout from 'pages/PageLanding/routes/PageAbout';

export default class PageHomeLayout extends Component {
  render() {
    return (
      <div className="PageLanding">
        <Route exact path="/" component={PageMain} />
        <Route path="/support" component={PageSupport} />
        <Route path="/about" component={PageAbout} />
      </div>
    );
  }
}
